ow/example_dags/example_latest_only_with_trigger.py','/home/manisha/airflow/dags','airflow',NULL,NULL,'grid','{\"type\": \"timedelta\", \"attrs\": {\"days\": 0, \"seconds\": 14400, \"microseconds\": 0}}','','null',16,16,0,0,0,'2024-06-18 00:00:00.000000','2024-06-18 00:00:00.000000','2024-06-18 04:00:00.000000','2024-06-18 04:00:00.000000'),('tutorial',NULL,1,0,0,'2024-06-18 06:06:57.853796',NULL,NULL,NULL,NULL,'/home/manisha/airflow_env/lib/python3.10/site-packages/airflow/example_dags/tutorial.py','/home/manisha/airflow/dags','airflow',NULL,'A simple tutorial DAG','grid','{\"type\": \"timedelta\", \"attrs\": {\"days\": 1, \"seconds\": 0, \"microseconds\": 0}}','','null',16,16,0,0,0,'2024-06-17 00:00:00.000000','2024-06-17 00:00:00.000000','2024-06-18 00:00:00.000000','2024-06-18 00:00:00.000000'),('tutorial_dag',NULL,1,0,0,'2024-06-18 06:06:58.243950',NULL,NULL,NULL,NULL,'/home/manisha/airflow_env/lib/python3.10/site-packages/airflow/example_dags/tutorial_dag.py','/home/manisha/airflow/dags','airflow',NULL,'DAG tutorial','grid','null','Never, external triggers only','null',16,16,0,0,0,NULL,NULL,NULL,NULL),('tutorial_objectstorage',NULL,1,0,0,'2024-06-18 06:06:32.187869',NULL,NULL,NULL,NULL,'/home/manisha/airflow_env/lib/python3.10/site-packages/airflow/example_dags/tutorial_objectstorage.py','/home/manisha/airflow/dags','airflow',NULL,NULL,'grid','null','Never, external triggers only','null',16,16,0,0,0,NULL,NULL,NULL,NULL),('tutorial_taskflow_api',NULL,1,0,0,'2024-06-18 06:06:59.171945',NULL,NULL,NULL,NULL,'/home/manisha/airflow_env/lib/python3.10/site-packages/airflow/example_dags/tutorial_taskflow_api.py','/home/manisha/airflow/dags','airflow',NULL,NULL,'grid','null','Never, external triggers only','null',16,16,0,0,0,NULL,NULL,NULL,NULL),('tutorial_taskflow_api_virtualenv',NULL,1,0,0,'2024-06-18 06:06:31.572248',NULL,NULL,NULL,NULL,'/home/manisha/airflow_env/lib/python3.10/site-packages/airflow/example_dags/tutorial_taskflow_api_virtualenv.py','/home/manisha/ai